Description:
Автомобіль у відмінному стан. GL 350 CDI 4MATIC. Модельний ряд 164. Пригнаний з Америки з мінімальними пошкодженнями. Обслуговується на офіційному СТО. Відмінна гума. Ходова без сторонніх звуків.
Автомобіль оснащений Системою AIRMATIC DC/Полуктівная пневмопідвіска. 3-й ряд сидінь з електроприводом для відкидання.
АКПП 7-СТУП. Оздоблення салону Штучна шкіра - Чорна/Антрацит. Система PARKTRONIC, зсувний скляний електро люк і багато іншого.

Детальніше на всі питання відповість менеджер Ляшок В'ячеслав.

Запрошуємо Вас пройти тест драйв даного автомобіля попередньо записавшись.

Також ми надаємо послуги:

- Trade-In/ОБМІН;
- РЕАЛІЗАЦІЯ вашого авто;
- КРЕДИТ/ЛІЗИНГ;
- ДОСТАВКА авто в будь-який регіон України;
- Придбання авто по безготівковим розрахунком;

Продам Mercedes GL 320 в самой полной комплектации. Автомобиль полностью обслужен перебрана полностью ходовая.
 Детальнее на вопросы ответит менеджер ФУРТАТОВ АЛЕКСАНДР 
Приглашаем Вас пройти Тест-Драйв данного автомобиля предварительно записавшись. 
А также мы предоставляем услуги: 
- Trade-In/ОБМЕН; 
- РЕАЛИЗАЦИЯ вашего авто; 
- КРЕДИТ /ЛИЗИНГ; 
- ДОСТАВКА в любой регион Украины; 
- Приобретение авто по БЕЗНАЛИЧНОМУ расчёту.
